var hyrrokkin = hyrrokkin || {};

hyrrokkin.RemoteStore = class extends hyrrokkin.StoreBase {

    constructor(send_fn, topologies) {
        super();
        this.send_fn = send_fn;
        this.topologies = topologies;
        this.options = null;
    }

    async init(options)  {
        this.options = options;
    }

    async create_topology(topology_id, from_topology_id) {
        this.send_fn({
            "action":"create_topology",
            "topology_id":topology_id,
            "from_topology_id":from_topology_id
        });
    }

    async remove_topology(topology_id) {
        this.send_fn({
            "action":"remove_topology",
            "topology_id":topology_id
        });
    }

    async reload_topology(topology_id) {
        this.send_fn({
            "action":"reload_topology",
            "topology_id":topology_id
        });
    }

    async list_topologies() {
        return Object.keys(this.topologies);
    }

    async topology_exists(topology_id) {
        return topology_id in this.topologies;
    }

    async get_topology_details() {
        return this.topologies;
    }

    async get_topology_metadata(topology_id) {
        return this.topologies[topology_id];
    }

    async update_status(payload) {
        let topology_id = payload["topology_id"];
        let status = payload["status"];
        this.hyrrokkin_directory_api.topology_status_updated(topology_id, status);
    }

    async recv(payload) {
        let action = payload["action"];
        switch(action) {
            case "remove_topology":
                await this.topology_removed(payload["topology_id"]);
                break;
            case "create_topology":
                await this.add_topology(payload["topology_id"],payload["metadata"],payload["status"]);
                break;
            case "update_metadata":
                await this.topology_metadata_updated(payload["topology_id"],payload["metadata"]);
                break;
            case "update_status":
                await this.topology_status_updated(payload["topology_id"], payload["status"]);
                break;
        }
    }
}


