var hyrrokkin = hyrrokkin || {};

hyrrokkin.LocalStore = class extends hyrrokkin.StoreBase {

    constructor(options) {
        super();
        this.options = options;
        this.workspace_id = options.workspace_id;
    }

    async create_topology(topology_id, from_topology_id) {
        // if the topology to create already exists, remove it
        let exists = await hyrrokkin.LocalStore.topology_exists(this.workspace_id,topology_id);
        if (exists) {
            await this.remove_topology(topology_id);
        }
        if (from_topology_id) {
            // copy from an existing topology
            if (!(await hyrrokkin.LocalStore.topology_exists(this.workspace_id, from_topology_id))) {
                // existing topology does not exist, see if it defined as a template
                if (from_topology_id in this.options.templates) {
                    // load from the template zip into the topology db
                    let url = this.options.templates[from_topology_id].url;
                    let r = await fetch(url);
                    let blob = await r.blob();
                    let topology_db = new hyrrokkin_engine.ClientStorage(hyrrokkin.LocalStore.get_topology_path(this.workspace_id, topology_id));
                    await hyrrokkin.LocalStore.load_db(blob, topology_db);
                }
            } else {
                let from_topology_db = new hyrrokkin_engine.ClientStorage(hyrrokkin.LocalStore.get_topology_path(this.workspace_id,from_topology_id));
                try {
                    await from_topology_db.copy_to(hyrrokkin.LocalStore.get_topology_path(this.workspace_id,topology_id));
                } finally {
                    from_topology_db.close();
                }
            }
        }
        // register the new topology in the workspace
        await hyrrokkin.LocalStore.register_topology(this.workspace_id, topology_id);
    }

    async reload_topology(topology_id) {
        // removing the topology has the effect of reloading from the template when the topology is next opened
        await this.remove_topology(topology_id);
    }

    async remove_topology(topology_id) {
        let topology_db = new hyrrokkin_engine.ClientStorage(hyrrokkin.LocalStore.get_topology_path(this.workspace_id,topology_id));
        try {
            await topology_db.remove();
        } finally {
            topology_db.close();
        }
        let db = await hyrrokkin.LocalStore.open_workspace(this.workspace_id);
        try {
            await db.remove_item(topology_id);
        } finally {
            db.close();
        }
    }

    async list_topologies() {
        let db = await hyrrokkin.LocalStore.open_workspace(this.workspace_id);
        try {
            let topology_ids = await db.get_keys();
            if (this.options.templates) {
                for (let topology_id in this.options.templates) {
                    if (!topology_ids.includes(topology_id)) {
                        topology_ids.push(topology_id);
                    }
                }
            }
            return topology_ids;
        } finally {
            db.close();
        }
    }

    static
    async topology_exists(workspace_id, topology_id) {
        let db = await hyrrokkin.LocalStore.open_workspace(workspace_id);
        try {
            let topology_info = await db.get_item(topology_id);
            return (topology_info !== null);
        } finally {
            db.close();
        }
    }

    async get_topology_details() {
        let db = await hyrrokkin.LocalStore.open_workspace(this.workspace_id);
        try {
            let topology_ids = await db.get_keys();
            let topologies = {};
            for (let idx = 0; idx < topology_ids.length; idx++) {
                let topology_id = topology_ids[idx];
                let metadata = await this.get_topology_metadata(topology_id);
                if (this.options.templates && topology_id in this.options.templates) {
                    metadata["has_template"] = true;
                }
                topologies[topology_id] = {"metadata": metadata};
            }
            if (this.options.templates) {
                for (let topology_id in this.options.templates) {
                    if (!(topology_id in topologies)) {
                        let metadata = this.options.templates[topology_id];
                        metadata["has_template"] = true;
                        topologies[topology_id] = {"metadata": metadata};
                    }
                }
            }
            return topologies;
        } finally {
            db.close();
        }
    }

    async get_topology_metadata(topology_id) {
        let topology_db = new hyrrokkin_engine.ClientStorage(hyrrokkin.LocalStore.get_topology_path(this.workspace_id,topology_id));
        try {
            let topology = await topology_db.get_item("topology.json");
            let obj = JSON.parse(topology);
            if (!obj) {
                obj = {"metadata": {}, "packages": []};
            }
            let metadata = obj["metadata"] || {};
            return metadata;
        } finally {
            topology_db.close();
        }
    }

    static
    get_workspace_path(workspace_id, path) {
        return "workspace."+workspace_id+"."+path;
    }

    static
    get_topology_path(workspace_id, topology_id) {
        if (topology_id) {
            return "workspace." + workspace_id + ".topology." + topology_id;
        } else {
            throw new Error("empty topology id");
        }
    }

    static
    async open_workspace(workspace_id) {
        // open and return the workspace
        let db = new hyrrokkin_engine.ClientStorage(hyrrokkin.LocalStore.get_workspace_path(workspace_id,"__root__"));
        await db.open();
        return db;
    }

    static
    async register_topology(workspace_id, topology_id) {
        // create a workspace entry for specified topology
        let ws = await hyrrokkin.LocalStore.open_workspace(workspace_id);
        try {
            await ws.set_item(topology_id, {});
        } finally {
            ws.close();
        }
    }

    static
    async load_db(from_blob, db) {
        const fileReader = new zip.BlobReader(from_blob);
        const zipReader = new zip.ZipReader(fileReader);
        let entries = await zipReader.getEntries();
        for (let idx = 0; idx < entries.length; idx++) {
            let entry = entries[idx];
            let name = entry.filename;
            if (name === "topology.json" || name.endsWith("/properties.json")) {
                let text = await entry.getData(new zip.TextWriter());
                await db.set_item(name, text);
            } else {
                let blob = await entry.getData(new zip.BlobWriter());
                let buffer = await blob.arrayBuffer();
                await db.set_item(name, buffer);
            }
        }
    }

}

