var hyrrokkin = hyrrokkin || {};

hyrrokkin.NodeType = class {

    constructor(node_type_id, package_type, schema) {
        this.metadata = ("metadata" in schema) ? structuredClone(schema["metadata"]) : {};
        this.id = package_type.get_qualified_id(node_type_id);
        this.package_type = package_type;
        this.schema = schema;
        this.package_id = package_type.get_id();

        let input_ports = schema["input_ports"] || {};
        let output_ports = schema["output_ports"] || {};

        this.input_ports = {};
        this.output_ports = {};

        for (let key in input_ports) {
            let pt = new hyrrokkin.PortType("input", true);
            pt.deserialise(input_ports[key]);
            this.input_ports[key] = pt;
        }

        for (let key in output_ports) {
            let pt = new hyrrokkin.PortType("output", false);
            pt.deserialise(output_ports[key]);
            this.output_ports[key] = pt;
        }
        this.display = schema["display"] || {"corners": 4, "icon": ""};
        this.clients = schema["pages"] || {};
        this.html_urls = {};
        for (let client_name in this.clients) {
            let url = this.clients[client_name].url;
            this.html_urls[client_name] = url ? this.package_type.get_resource_url(url) : "";
        }

        this.hide = false;

        this.configure_display(package_type);
    }

    get_metadata() {
        return this.metadata;
    }

    get_schema() {
        return this.schema;
    }

    allow_multiple_input_connections(input_port_name) {
        return this.input_ports[input_port_name].get_allow_multiple_connections();
    }

    allow_multiple_output_connections(output_port_name) {
        return this.output_ports[output_port_name].get_allow_multiple_connections();
    }

    get_input_link_type(input_port_name) {
        return this.input_ports[input_port_name].get_link_type();
    }

    get_output_link_type(output_port_name) {
        return this.output_ports[output_port_name].get_link_type();
    }

    get_id() {
        return this.id;
    }

    get_type() {
        return this.id;
    }

    get_package_id() {
        return this.package_id;
    }

    get_package_type() {
        return this.package_type;
    }

    get_name() {
        return this.metadata["name"] || this.id;
    }

    get_description() {
        return this.metadata["description"] || "";
    }

    get_html_url(client_name) {
        return this.package_type.localise(this.html_urls[client_name]);
    }

    get_client_names() {
        let client_names = [];
        for (let client_name in this.clients) {
            client_names.push(client_name);
        }
        return client_names;
    }

    get_client(client_name) {
        return this.clients[client_name];
    }

    configure_display(package_type) {
        let pdisplay = package_type.get_display();
        for (let key in pdisplay) {
            if (!this.display[key]) {
                this.display[key] = pdisplay[key];
            }
        }
        if ("icon" in this.display) {
            this.image = package_type.get_base_url() + "/" + this.display["icon"];
        } else {
            this.image = "";
        }
    }

    get_icon_url() {
        if (this.display) {
            return this.display.icon;
        }
        return undefined;
    }

    get_display() {
        return this.display;
    }

    get_l10n_utils() {
        return this.package_type.get_l10n_utils();
    }
}




/* src/js/schema/package_type.js */

var hyrrokkin = hyrrokkin || {};

hyrrokkin.PackageType = class {

    constructor(id, url, obj) {
        this.metadata = ("metadata" in obj) ? structuredClone(obj["metadata"]) : {};
        this.id = id;
        this.base_url = url;
        this.configuration = obj["configuration"] || {};
        this.sources = [];
        this.node_types = {};
        this.link_types = {};
        this.schema = obj;

        let node_types = obj["node_types"];
        for (let node_type_id in node_types) {
            this.node_types[node_type_id] = this.create_node_type(node_type_id, node_types[node_type_id]);
        }

        let link_types = obj["link_types"];
        for (let link_type_id in link_types) {
            this.link_types[link_type_id] = this.create_link_type(link_type_id, link_types[link_type_id]);
        }
        this.display = obj["display"] || {};
        this.l10n = obj["l10n"];
        this.l10n_utils = null;
    }

    async load_sources() {
        const sources_url = this.base_url + "/javascript.json";
        try {
            this.sources = await fetch(sources_url)
                .then(
                    r => r.json()
                ).then(
                    o => o["source_paths"]
                );
        } catch (e) {
            this.sources = [];
        }
    }

    get_sources() {
        return this.sources;
    }

    get_schema() {
        return this.schema;
    }

    get_id() {
        return this.id;
    }

    get_node_types() {
        return this.node_types;
    }

    get_node_type(node_type_id) {
        return this.node_types[node_type_id];
    }

    get_link_types() {
        return this.link_types;
    }

    get_metadata() {
        return this.metadata;
    }

    get_base_url() {
        return this.base_url;
    }

    get_resource_url(resource) {
        if (resource.startsWith("http")) {
            // resource is already an absolute URL
            return resource;
        }
        let resource_url = this.base_url + "/" + resource;
        return String(resource_url);
    }

    get_qualified_id(id) {
        return this.id + ":" + id;
    }

    get_configuration() {
        return this.configuration;
    }

    create_node_type(node_type_id, node_type_schema) {
        return new hyrrokkin.NodeType(node_type_id, this, node_type_schema);
    }

    create_link_type(link_type_id, link_type_schema) {
        return new hyrrokkin.LinkType(link_type_id, this, link_type_schema);
    }

    get_l10n() {
        return this.l10n;
    }

    async load_l10n() {
        this.l10n_utils = new hyrrokkin.L10NUtils("package." + this.id, this.base_url);
        if (this.l10n) {
            this.l10n_utils.configure_for_package(this.l10n);
            await this.l10n_utils.initialise();
        }
    }

    get_l10n_utils() {
        return this.l10n_utils;
    }

    localise(txt) {
        if (this.l10n_utils) {
            return this.l10n_utils.localise(txt);
        } else {
            return txt;
        }
    }

    get_display() {
        return this.display;
    }
}



/* src/js/schema/schema.js */

var hyrrokkin = hyrrokkin || {};

hyrrokkin.SchemaError = class extends Error {

    constructor(message) {
        super(message)
        this.name = "HyrrokkinSchemaError";
    }

}

hyrrokkin.Schema = class {

    constructor() {
        this.package_types = {};
        this.node_types = {};
        this.link_types = {};
    }

    async load_package(url,obj) {
        let id = obj["id"];

        if (id in this.package_types) { // this package already loaded?
            return;
        }

        let package_type = new hyrrokkin.PackageType(id, url, obj);
        await package_type.load_l10n("");

        this.package_types[package_type.get_id()] = package_type;

        let node_types = package_type.get_node_types();
        for(let node_id in node_types) {
            let node_type = node_types[node_id];
            this.node_types[node_type.get_id()] = node_type;
        }

        let link_types = package_type.get_link_types();
        for(let link_id in link_types) {
            let link_type = link_types[link_id];
            this.link_types[link_type.get_id()] = link_type;
        }

        return package_type;
    }

    get_resource_url(package_id, relative_path) {
       return this.package_types[package_id].get_resource_url(relative_path);
    }

    get_node_type(id) {
        return this.node_types[id];
    }

    async get_resource_urls() {
        let resource_urls = [];
        for(let package_id in this.package_types) {
            let package_type = this.package_types[package_id];
            await package_type.load_sources();
            package_type.get_sources().forEach(item => {
                resource_urls.push(package_type.get_resource_url(item))
            });
        }
        return resource_urls;
    }

    get_link_type(id) {
        return this.link_types[id];
    }

    get_link_colour(id) {
        if (id in this.link_types) {
            return this.link_types[id].get_colour();
        }
        return "grey";
    }

    get_package_type(id) {
        return this.package_types[id];
    }

    has_package_type(id) {
        return (id in this.package_types);
    }

    get_package_types() {
        return Object.keys(this.package_types);
    }

    get_packages_list() {
        let result = [];
        for (let key in this.package_types) {
            let pt = this.package_types[key];
            result.push({"id":pt.get_id(),"metadata":pt.get_metadata()});
        }
        return result;
    }

    get_node_types() {
        let ids = [];
        for (let key in this.node_types) {
            ids.push(key);
        }
        return ids;
    }
}



