var hyrrokkin = hyrrokkin || {};

hyrrokkin.VERSION = "0.1.5";

hyrrokkin.SystemBase = class {

    constructor() {
        this.core = null;
    }

    set_core(core) {
        this.core = core;
        window.addEventListener("beforeunload", (evt) => {
            // this is triggered only if the user has had some interaction with the page
            this.core.close();
            // evt.preventDefault();
        });
    }

    get_core() {
        return this.core;
    }

    has_node(node_id) {
        return this.core.get_network().has_node(node_id);
    }

    register_platform_extension(name, version, url) {
        this.extensions.push({
            "name": name,
            "version": version,
            "url": url
        });
    }

    async load_l10n() {
        let l10n_utils = new hyrrokkin.L10NUtils("system", hyrrokkin.api_home_url + "/l10n");
        await l10n_utils.initialise();
        return l10n_utils;
    }

    merge_config(o1, o2) {
        let combined = {};
        if (typeof o1 === 'object' && !Array.isArray(o1)) {
            // merge dictionaries
            for(let key in o1) {
                if (key in o2) {
                    combined[key] = this.merge_config(o1[key],o2[key]);
                } else {
                    combined[key] = o1[key];
                }
            }
            if (typeof o2 === 'object' && !Array.isArray(o2)) {
                for(let key in o2) {
                    if (!(key in combined)) {
                        combined[key] = o2[key];
                    }
                }
            }
            return combined;
        }
        return o1;
    }

    /**
     * Load schemas into hyrrokkin
     *
     * @param {Array} package_urls - an array of urls pointing to packages
     */
    async load_schema(package_urls) {
        let load_package_from_url = async (url,schema) => {
            let schema_content = await fetch(url+"/schema.json");
            let schema_config = await schema_content.json();
            await schema.load_package(url, schema_config);
        }

        let schema = new hyrrokkin.Schema();

        for (let idx = 0; idx < package_urls.length; idx++) {
            await load_package_from_url(package_urls[idx],schema);
        }
        return schema;
    }

    async load(from_obj, node_renamings, suppress_callbacks) {
        return await this.core.deserialise(from_obj ,node_renamings, suppress_callbacks);
    }

    save() {
        return this.core.serialise();
    }

    get_package_list() {
        return this.core.schema.get_package_types();
    }

    get_network() {
        return this.core.get_network();
    }

    set_node_status(node_id, status_msg, state) {
        this.core.update_node_status(node_id, state, status_msg);
    }

    set_configuration_status(package_id, status_msg, state) {
        this.core.update_configuration_status(package_id, state, status_msg);
    }

    update_execution_state(node_id, state, is_manual) {
        this.core.update_execution_state(node_id, state, is_manual);
    }

    execution_complete() {
        this.core.execution_complete();
    }

    get_version() {
        return hyrrokkin.VERSION;
    }

    add_node_event_handler(node_event_type, handler) {
        switch(node_event_type) {
            case "request_add":
            case "request_remove":
            case "request_update_metadata":
                return this.core.add_node_event_handler(node_event_type,handler);
            default:
                console.warn("No Handler for node event type: "+node_event_type);
                return null;
        }
    }

    remove_node_event_handler(node_event_type, handler) {
        this.core.remove_node_event_handler(node_event_type, handler);
    }

    add_link_event_handler(link_event_type, handler) {
        switch(link_event_type) {
            case "request_add":
            case "request_remove":
                return this.core.add_link_event_handler(link_event_type, handler);
            default:
                console.warn("No Handler for link event type: " + link_event_type);
                return null;
        }
    }

    remove_link_event_handler(link_event_type, handler) {
        this.core.remove_node_event_handler(link_event_type, handler);
    }

    add_design_event_handler(design_event_type, handler) {
        switch(design_event_type) {
            case "request_load":
            case "request_clear":
            case "request_update_metadata":
            case "request_pause":
            case "request_resume":
            case "request_restart":
            case "request_close":
                return this.core.add_design_event_handler(design_event_type, handler);
            default:
                console.warn("No Handler for link event type: " + design_event_type);
                return null;
        }
    }

    remove_design_event_handler(design_event_type, handler) {
        this.core.remove_design_event_handler(design_event_type, handler);
    }

    request_open_client(origin_id, origin_type, client_name) {
        if (origin_type === "node") {
            this.core.request_node_open_client(origin_id, client_name);
        }
        if (origin_type === "configuration") {
            this.core.request_configuration_open_client(origin_id, client_name);
        }
    }

    note_paused() {
    }

    note_resumed() {
    }

    note_restarted() {
    }
}

