var hyrrokkin = hyrrokkin || {};

hyrrokkin.DirectorySystem = class extends hyrrokkin.SystemBase {

    constructor(element_id, options, model) {
        super();

        this.title = options.title || "";

        this.container = hyrrokkin.$$$(element_id);

        this.header = this.container.append("div").attr("class", "hyrrokkin_header");

        if (options.directory_title) {
            this.header.append("h4").attr("class", "hyrrokkin_header_title").text(options.directory_title);
            this.header.append("span").attr("class", "hyrrokkin_header_text").text(options.workspace_id);
        }

        let right_div = this.header.append("div")
            .attr("class", "hyrrokkin_header_right");

        right_div.append("img").attr("src", options.icon_url || "hyrrokkin-ui/images/hyrrokkin-ui.svg").attr("class", "hyrrokkin_header_icon");

        this.root_element = this.container.append("div");

        if (options.directory_extra_urls) {
            let extra_urls_div = this.root_element.append("div").style("margin", "10px");
            let extra_urls_count = 0;
            for(let url in options.directory_extra_urls) {
                if (extra_urls_count > 0) {
                    extra_urls_div.append("span").text("|").style("margin-left","10px").style("margin-right","10px");
                }
                extra_urls_count += 1;
                let text = options.directory_extra_urls[url];
                extra_urls_div.append("a").attr("href",url).text(text);
            }
        }

        this.root_list = null;
        this.app_list = null;

        this.open_topology_in_designer_callback = null;
        this.topologies = {};
        this.topology_metadata = {};
        this.application_metadata = options["applications"] || {};

        this.options = options;
        this.topology_store = model;
        this.l10n_utils = null;
    }

    async load() {
        this.splash_screen = null;
        this.l10n_utils = await this.load_l10n();
        let splash_options = this.options["directory_splash"];
        if (splash_options) {
            this.splash_screen = new hyrrokkin.Alert(this.l10n_utils.localise("directory.loading"),splash_options);
        }

        this.schema = await this.load_schema(this.options.package_urls);
        await this.topology_store.init(this.options);

        let topology_details = await this.topology_store.get_topology_details();
        this.draw(topology_details);

        if (this.splash_screen) {
            setTimeout(() => {
                this.splash_screen.close();
                this.splash_screen = null;
            },1000);
        }

        if (this.options.directory_refresh_interval) {
            setTimeout(() => {
                this.refresh().then(() => {});
            }, 1000*this.options.directory_refresh_interval);
        }
    }

    async refresh() {
        let topology_details = await this.topology_store.get_topology_details();

        for(let topology_id in topology_details) {
            this.topology_metadata_updated(topology_id, topology_details[topology_id].metadata);
        }
        setTimeout(() => {
                this.refresh().then(() => {});
            }, 1000*this.options.directory_refresh_interval);
    }

    set_open_topology_in_designer_handler(callback) {
        this.open_topology_in_designer_callback = callback;
    }

    make_create_topology_callback() {
        return async () => {
            let topology_id = this.create_name_input.node().value;
            let copy_from_id = this.copy_topology_select.node().value;

            if (!(topology_id in this.topology_metadata)) {
                let splash_screen = new hyrrokkin.Alert(this.l10n_utils.localise("directory.copying"), {});
                await this.topology_store.create_topology(topology_id, copy_from_id);
                splash_screen.close();
            }

            this.add_topology(topology_id, {}, {});
            this.update_copy_options();
        }
    }

    update_copy_options() {
        let copy_options = [["",""]];
        for(let topology_id in this.topologies) {
            copy_options.push([topology_id,topology_id]);
        }
        this.copy_topology_select.attr("options", JSON.stringify(copy_options));
    }

    draw(initial_topologies) {
        let l10n_row = this.root_element.append("div").add_class("exo-row");

        /* render controls */

        let create_fieldset = l10n_row.append("div").append("fieldset");
        create_fieldset.append("legend").text(this.l10n_utils.localise("create_topology"));
        let create_row = create_fieldset.append("div").add_class("exo-row");

        this.create_name_input = create_row.append("div").add_class("exo-2-cell")
            .text(this.l10n_utils.localise("topology_id"))
            .append("input").attr("type","text");

        this.create_name_input.on("input", (evt) => {
            if (evt.target.value === "") {
                this.update_creation_buttons(false);
            } else {
                this.update_creation_buttons(true);
            }
        });

        this.create_topology_button = create_row.append("div").add_class("exo-cell")
            .html("&#8203;") // blank label to align button with input box
            .append("input").attr("type","button").attr("value",this.l10n_utils.localise("create"));

        let copy_options = [["",""]];
        this.copy_topology_select = create_row.append("div").add_class("exo-cell")
            .append("exo-select").attr("options",JSON.stringify(copy_options)).attr("label",this.l10n_utils.localise("directory.copy_from"));

        this.create_topology_button.on("click", this.make_create_topology_callback());

        let l10n_fieldset = l10n_row.append("div").attr("id","l10n_controls").append("fieldset")
        l10n_fieldset.append("legend").text(this.l10n_utils.localise("configuration.system.language"));
        l10n_fieldset.node().appendChild(this.l10n_utils.create_language_select());

        this.root_element.append("h4").text(this.l10n_utils.localise("topologies"));
        this.root_list = this.root_element.append("div").attr("class", "exo-tree").attr("role", "tree").append("ul");

        if (this.application_metadata && Object.keys(this.application_metadata).length > 0) {
            this.root_element.append("h4").text(this.l10n_utils.localise("applications"));
            this.app_list = this.root_element.append("div").attr("class", "exo-tree").attr("role", "tree").append("ul");
        } else {
            this.app_list = null;
        }

        /* render the tree with topologies */

        this.topologies = {};
        for(let topology_id in initial_topologies) {
            this.add_topology(topology_id, initial_topologies[topology_id]["metadata"]);
        }

        if (this.application_metadata) {
            for (let application_id in this.application_metadata) {
                this.render_application(application_id);
            }
        }

        this.update_creation_buttons(false);
        this.update_copy_options();
    }

    add_topology(topology_id, metadata) {
        if (topology_id in this.topologies) {
            return; // already exists?
        }
        this.topology_metadata[topology_id] = metadata || {};

        this.render_topology(topology_id);
    }

    topology_removed(topology_id) {
        if (topology_id in this.topologies) {
            this.topologies[topology_id].treeitem.remove();
            delete this.topologies[topology_id];
        }
        if (topology_id in this.topology_metadata) {
            delete this.topology_metadata[topology_id];
        }
        this.update_copy_options();
    }

    async remove_topology(topology_id) {
        this.topology_removed(topology_id);
        await this.topology_store.remove_topology(topology_id);
    }

    topology_metadata_updated(topology_id, updated_metadata) {
        this.topology_metadata[topology_id] = updated_metadata;
        this.render_metadata(this.topologies[topology_id]["metadata_table"], updated_metadata);
        let label_txt = topology_id;
        let name = updated_metadata["name"];
        if (name) {
            label_txt += " / " + name;
        }
        this.topologies[topology_id]["label"].text(label_txt);
    }

    async reload_topology(topology_id) {
        // reload a topology by removing from the store
        await this.topology_store.reload_topology(topology_id);
    }

    update_creation_buttons(enabled) {
        this.create_topology_button.node().disabled = !enabled;
    }

    render_topology(topology_id) {
        let metadata = this.topology_metadata[topology_id];

        let li = this.root_list.append("li").attr("role", "treeitem");
        let input = li.append("input").attr("type", "checkbox").attr("aria-hidden", "true");

        let label = li.append("label").style("margin-left","10px");

        let label_span = label.append("span");
        let label_txt = topology_id;
        let name = metadata["name"];
        if (name) {
            label_txt += " / " + name;
        }

        label_span.text(label_txt);

        label.append("a").attr("href", "#0").text(this.l10n_utils.localise("open_topology_in_designer"))
            .add_class("open_link").on("click", () => {
            this.open_topology_in_designer_callback(topology_id);
        });

        let pdiv = li.append("div");

        let div = pdiv.append("div").attr("class", "exo-row");

        let metadata_table = div.append("table").add_class("metadata_table");

        this.render_metadata(metadata_table, metadata);

        let p = pdiv.append("div").attr("class","exo-row").append("p");

        if (metadata["has_template"]) {
            let reload_label = this.l10n_utils.localise("directory.reload");
            p.append("div").attr("exo-1-cell").append("input").attr("type", "button").attr("value", reload_label).on("click", async (evt) => {
                await this.reload_topology(topology_id);
            });
        } else {
            let remove_label = this.l10n_utils.localise("directory.remove");
            p.append("div").attr("exo-1-cell").append("input").attr("type", "button").attr("value", remove_label).on("click", async (evt) => {
                await this.remove_topology(topology_id);
            });
        }

        this.topologies[topology_id] = { "treeitem":li, "metadata_table": metadata_table, "label":label_span };
    }

    render_metadata(tbl, metadata) {
        tbl.html("");
        let pmetadata = {};
        for (let key in metadata) {
            pmetadata[key] = metadata[key];
        }

        if (pmetadata) {
            let keys = [];
            ["name", "description", "version", "authors"].forEach(key => {
                if (pmetadata[key]) {
                    keys.push(key);
                }
            });

            if (keys.length > 1) {
                keys.forEach((key) => {
                    let lkey = this.l10n_utils.localise("metadata." + key);
                    let lcontent = pmetadata[key];
                    let txt = "";
                    lcontent.split("\n").forEach(item => {
                        if (txt != "") {
                            txt += "<br>"
                        }
                        txt += item;
                    });
                    let tr = tbl.append("tr");
                    tr.append("td").text(lkey + ":");
                    tr.append("td").html(txt);
                });
            }
        }
    }

    render_application(application_id) {
        let metadata = this.application_metadata[application_id];
        let li = this.app_list.append("li").attr("role","treeitem");
        let input = li.append("input").attr("type","checkbox").attr("aria-hidden","true");
        let label = li.append("label").style("margin-left","10px");

        let label_txt = metadata.label;

        label.text(label_txt);
        let application_url = metadata["application_url"] ||
            this.options["application_url"]+"?application_id="+application_id ||
            "hyrrokkin-application.html?application_id="+application_id;
        label.append("a").attr("href",application_url).attr("target","_self").text(this.l10n_utils.localise("open_application"))
            .add_class("open_link");
    }
}






/* src/js/directory_api.js */

var hyrrokkin = hyrrokkin || {};

hyrrokkin.api_home_url = document.currentScript.src.split("/").slice(0,-1).join("/");

hyrrokkin.DirectoryApi = class {

    constructor(element_id, options, model) {
        this.system = new hyrrokkin.DirectorySystem(element_id, options, model);
    }

    async load() {
        await this.system.load();
    }

    set_open_topology_in_designer_handler(handler) {
        this.system.set_open_topology_in_designer_handler(handler);
    }
}

/**
  * Asynchronous function to create a hyrrokkin graphical editor widget
  *
  * @param {string} element_id - the name of the document element into which hyrrokkin will be loaded
  * @param {Object} options - various options to customise hyrrokkin
  * @param {Object} model - an instance implementing hyrrokkin.StoreBase
  */
hyrrokkin.start_directory = async function(element_id, options, model) {

    let directory_api = new hyrrokkin.DirectoryApi(element_id, options, model);
    await directory_api.load();
    return directory_api;
}


